function GetVmScreenshot(wsObj, message) {
  var VmRecordId = message.VmRecordId;
  var messages = [];
  if (VmRecordId === "3") {
    messages.push({
      type: "SetVmScreenshot",
      vmRecordId: VmRecordId,
      data:
        getVmState(VmRecordId) === "PoweredOn"
          ? ""
          : `{"err":"VM is not PoweredOn"}`,
    });
  } else if (VmRecordId === "4" || true) {
    messages.push({
      type: "SetVmScreenshot",
      vmRecordId: VmRecordId,
      data:
        getVmState(VmRecordId) === "PoweredOn"
          ? ""
          : `{"err":"VM is not PoweredOn"}`,
    });
  }
  setTimeout(() => {
    wsObj.onmessage({
      data: JSON.stringify(messages),
    });
  }, 700);
}

function getVmState(vmRecordId) {
  if (!window.VmState || !window.VmState[`${vmRecordId}`]) return "PoweredOn";
  return `${window.VmState[`${vmRecordId}`]}`;
}

export default GetVmScreenshot;
